import "./App.css"
import Sidebar from "./components/sidebar/sidebar"
import Header from "./components/header/header"
import Dashboard from "./components/dashboard/dashboard"
import React from 'react'

function App() {

  const [selectedComponent, setSelectedComponent] = React.useState('Dashboard')

  return (
    <div className="App">
      <Sidebar
        selectedComponent={selectedComponent}
        changeComponent={setSelectedComponent}
      />
      <div className="container">
        <Header />
        {selectedComponent === 'Dashboard' && <Dashboard />}
        {selectedComponent === 'Bid' && <Dashboard />}
        {selectedComponent === 'Collection' && <Dashboard />}
        {selectedComponent === 'Profile' && <Dashboard />}
        {selectedComponent === 'Settings' && <Dashboard />}
      </div>
    </div>
  );
}

export default App;
